import React from 'react';
import Grid from '@material-ui/core/Grid';

const Introduction = () => {
	return (
		<Grid container direction='column' justify='center' alignItems='flex-start'>
			<Grid item>
				<h1 className='heading'>تایپ آنلاین به‌صرفه</h1>
			</Grid>
		</Grid>
	);
};

export default Introduction;
